import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Header from './components/Header.js';
import Menu from './components/Menu.js';
import Seccion from './components/Seccion.js';
import Footer from './components/Footer.js';
 // Asegúrate de que el archivo Footer.js existe en components
import './App.css'; // Asegúrate de que App.css esté en la carpeta src

const App = () => {
  return (
    <Router>
      <Header /> {/* El encabezado y menú */}
      <main>
        <Routes>
          <Route path="/" element={<Seccion titulo="Bienvenido a Autos 360" contenido="Aquí encontrarás los mejores autos." />} />
          <Route path="/autos" element={<Seccion titulo="Nuestros Autos" contenido="Explora nuestra gama de autos nuevos y usados." />} />
          <Route path="/contacto" element={<Seccion titulo="Contacto" contenido="Contáctanos para más información." />} />
        </Routes>
      </main>
      <Footer /> {/* El pie de página */}
    </Router>
  );
}

export default App;
